import React from "react";

const Footer = () => {
  return (
    <footer className="fixed bottom-0 w-full">
      <div className="ticker-container bg-yellow-300 h-10">
        <div className="animate-marquee text-[#2D0100] font-medium h-full flex justify-center items-center">
          START YOUR ADOPTION JOURNEY TODAY!
        </div>
      </div>
    </footer>
  );
};

export default Footer;
